	add("wart", "{\"term\":\"wart\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027wearte\u0027 from Proto-germanic {{m|gem-pro|*wartǭ}}. Cognate with Dutch \u0027wrat\u0027 German \u0027warze\u0027 Swedish \u0027vårta\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of deformed growth occurring on the skin caused by the human papillomavirus (HPV\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any similar growth occurring in plants or animals, such as the parotoid glands in the back of toads\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of the prefixes used in Hungarian notation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, \u0026quot;Chris Ahlstrom\u0026quot;, \u0027Hungarian notation\u0027 (on newsgroup \u0027microsoft.public.vc.language\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hungarian \u0027\u0027warts\u0027\u0027 suck big time! If you need them, your functions are too big and your class interface is much too fat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0026quot;Linonut\u0026quot;, \u0027Computer Science\u0027 (on newsgroup \u0027comp.os.linux.advocacy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Far easier to not use \u0027\u0027warts\u0027\u0027 in the first place. Even if a wart is present, you still have to verify the variable\u0027s declaration anyway, if you\u0027re a diligent maintenance programmer\", \"priority\":7}]}, \"synonyms\":{}}");

	add("waragi", "{\"term\":\"waragi\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Swahili\"], \"text\":\"Perhaps from Swahili \u0026lt;ref\u0026gt;Garland Hampton Cannon, \u0027The Arabic Contributions to the English Language: An Historical Dictionary\u0027\u0026lt;/ref\u0026gt; or perhaps a corruption of \u0026quot;\u0027war gin\u0027 quot; (a term applied to the drink on account of its consumption by soldiers).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A distilled alcoholic beverage made from bananas or millet, common in Uganda\", \"priority\":1}]}, \"synonyms\":{}}");

	add("waratah", "{\"term\":\"waratah\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"dharuk\"], \"text\":\"From Dharuk \u0027warada\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of plants in the genus , native to southeastern Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, \u0027My Love Must Wait\u0027, A\u0026amp;R Classics 2013, p. 156\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Acacias in blossom in the distance […]; leafy stipple of light and shade on the leaves, vivid flowers and bitter little fruits, and the \u0027\u0027waratah\u0027\u0027, like a blackfellow\u0027s firestick, red as a glowing coal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A Y-shaped steel fencing post or stake\", \"priority\":4}]}, \"synonyms\":{}}");

	add("warder", "{\"term\":\"warder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A guard, especially in a prison\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A truncheon or staff carried by a king or commander, used to signal commands\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1595\u0027\u0027, Samuel Daniel, \u0027Civil Wars\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When, lo! the king suddenly changed his mind, / Casts down his \u0027\u0027warder\u0027\u0027 to arrest them there\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"William Shakespeare, \u0027King Richard II, Act 1, Scene 3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Stay, the king hath thrown his \u0027\u0027warder\u0027\u0027 down\", \"priority\":6}]}, \"synonyms\":{}}");

