	add("wardrobe", "{\"term\":\"wardrobe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027warderobe\u0027, a northern variant of \u0027garderobe\u0027, from \u0027garder\u0027 ‘to keep safe’ + \u0027robe\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cabinet in which clothes may be stored\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dA canister of flour from the kitchen had been thrown at the looking-glass and lay like trampled snow over the remains of a decent blue suit with the lining ripped out which lay on top of the ruin of a plastic \u0027\u0027wardrobe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The department (or people working in that department) that obtains and stores articles of clothing for use in theatrical or motion picture productions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A collection of clothing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The clothing one owns or needs, often for a specific purpose such as work\", \"priority\":5}]}, \"synonyms\":{}}");

