	add("warehouse", "{\"term\":\"warehouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|ware|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place for storing large amounts of products (wares). In logistics, a place where products go to from the manufacturer before going to the retailer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21582512-explosion-start-ups-changing-finance-better-revenge-nerds Revenge of the passage\u003dThink of banking today and the image is of grey-suited men in towering skyscrapers. Its future, however, is being shaped in converted \u0027\u0027warehouses\u0027\u0027 and funky offices in San Francisco, New York and London, where bright young things in jeans and T-shirts huddle around laptops, sipping lattes or munching on free food\", \"priority\":2}]}, \"synonyms\":{}}");

