	add("warfare", "{\"term\":\"warfare\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"{{etystub|en|date\u003dMay 2012}}From 1425–75 late Middle english (1100-1500) \u0027werefare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The waging of war or armed conflict against an enemy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, 1 Sam. xxviii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Philistines gathered their armies together for \u0027\u0027warfare\u0027\u0027, to fight with Israel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Military operations of some particular kind e.g. guerrilla warfare\", \"priority\":4}]}, \"synonyms\":{}}");

