	add("warhorse", "{\"term\":\"warhorse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|war|horse|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any horse used in horse-cavalry, but especially one bearing an armored knight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"As he spoke, the knight-errant, who had remounted his \u0027\u0027warhorse\u0027\u0027, galloped forward to the royal stand, with a silken kerchief bound round his wounded arm.\u0027 — Arthur Conan Doyle, \u0027The White Company\u0027, s:The White Company/Chapter Chapter 26\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A regularly revived theatrical or musical work, as with \u0027Hamlet\u0027 or a Beethoven symphony, or as excerpts thereto. May imply that the work in question has become hackneyed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 \u0027Most important though is the fact that, for the first time in I can barely remember how long, the ROH mounts a new production of an Italian repertory \u0027\u0027warhorse\u0027\u0027 that is fully on the level of the one it replaces [and indeed, in some respects, surpasses it] [...] we actually have a \u0026quot;Tosca\u0026quot;.\u0027 — [http://groups.google.sm/group/rec.music.opera/browse_thread/thread/f6b61851eea2a30e/c9951c6fb15d3954?lnk\u003draot\u0026amp;hl\u003dit Google group\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An experienced person who has been through many battles, situations or contests; someone who has given long service\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;Srinath: India\u0027s warhorse\u0026quot; (headline from [http://news.bbc.co.uk/sport1/hi/cricket/specials/west_indies_v_india/2022023.stm BBC News\", \"priority\":6}]}, \"synonyms\":{}}");

