	add("warlock", "{\"term\":\"warlock\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|warloghe}}, {{m|enm|warlowe}}, {{m|enm|warloȝe}}, from Old english (ca. 450-1100) {{m|ang|wǣrloga||traitor, deceiver|lit\u003dtruce-breaker}}, from {{m|ang|wǣr||covenant, truce, pact, promise}} (from Proto-indo-european {{m|ine-pro|*wēr-||true}}; compare \u0027\u0027 + \u0027loga\u0027 (liar) from {{m|ang|lēogan}} ( \u0026gt; English \u0027lie\u0027 ; the ending in \u0027-ck\u0027 is from Scottish \u0026amp; Northern English. Cognate with Old high german (ca. 750-1050) {{m|goh|wārlogo||truce-breaker, traitor}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The male equivalent of witch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A traitor or oath-breaker\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Devil, Satan; a demon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"originally Scotland and Northern UK\u0027) A man in league with the Devil; a male magic-user, a wizard\", \"priority\":4}]}, \"synonyms\":{}}");

