	add("warmware", "{\"term\":\"warmware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|warm|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Humans, i.e. the users of technologies, as opposed to the hardware, software or firmware\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Bernard Mergen, \u0027Cultural dimensions of play, games, and sport\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I have moved to Silicon Valley to gain real-time, \u0027\u0027warmware\u0027\u0027 access to heroes of a truly virtual community\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, \u0027Language monthly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Warmware\u0027\u0027 are the teachers, learners, and users of languages and technologies. We realize the advantages that computers bring\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Marc A Annacchino, \u0027The pursuit of new product development: the business development process\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Where a simpler version would have served the application well, a new, more complex version is offered, requiring more \u0027\u0027warmware\u0027\u0027 (customer support personnel\", \"priority\":7}]}, \"synonyms\":{}}");

	add("warpath", "{\"term\":\"warpath\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|war|path|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The route taken by a party of Native Americans going on a warlike expedition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Henry R. Schoolcraft, \u0027The Myth of Hiawatha, and Other Oral Legends\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He went often to visit the spot where the women had buried her, and sat musing there, when, it was thought, by some of his friends, he would have done better to try to amuse himself in the chase, or by diverting his thoughts in the \u0027\u0027war-path\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A course of action that leads to battle or hostility\", \"priority\":4}]}, \"synonyms\":{}}");

