	add("warphan", "{\"term\":\"warphan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|war|orphan|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An orphan whose parents died due to war, especially in 20th-century China\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027, \u0027China Handbook\u0027, [https://books.google.com/books?id\u003dSwc_AQAAIAAJ\u0026amp;q\u003d%22warphans%22\u0026amp;dq\u003d%22warphans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOicXVZfYLYihNp7LgagD\u0026amp;ved\u003d0CCQQ6AEwAQ page 733\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In addition, the following organizations act as the Association\u0027s agencies in caring for \u0027\u0027warphans\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1940\u0027\u0027, \u0027Federal Council Bulletin\u0027, volumes 23-25, [https://books.google.com/books?id\u003da44eAQAAMAAJ\u0026amp;q\u003d%22warphan%22\u0026amp;dq\u003d%22warphan%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEicXVZLZIIjBggTei4LoAQ\u0026amp;ved\u003d0CHwQ6AEwEA\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2½ cents per meal\u0027\u0026lt;!--bold rather than italics in the original--\u0026gt; will support a \u0027\u0027warphan\u0027\u0027 and also provide educational and vocational training\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1944\u0027\u0027, \u0027China Magazine\u0027, volumes 12-13, [https://books.google.com/books?id\u003dQtA4AQAAIAAJ\u0026amp;q\u003d%22warphan%22\u0026amp;dq\u003d%22warphan%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEicXVZLZIIjBggTei4LoAQ\u0026amp;ved\u003d0CFsQ6AEwCw page 26\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027WARPHAN\u0027\u0027 COMES OF AG\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, K. Scott Wong, \u0027Americans First: Chinese Americans and the Second World War\u0027, [https://books.google.com/books?id\u003diyyaIGm5-nUC\u0026amp;lpg\u003dPA94\u0026amp;dq\u003d%22warphan%22\u0026amp;pg\u003dPA9\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22warphan%22\u0026amp;f\u003dfalse page 94\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Adopt a \u0027\u0027warphan\u0027\u0027 for a month\", \"priority\":10}]}, \"synonyms\":{}}");

