	add("warre", "{\"term\":\"warre\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1572\u0027\u0027, w:George George Gascoigne, \u0026quot;Dulce Bellum Inexpertis\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Poets olde in their fonde fables faine, / That mightie Mars is god of \u0027\u0027Warre\u0027\u0027 and Strife, / These astronomers thinke, where Mars doth raigne, / That all debate and discorde must he rife\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1651\u0027\u0027, w:Thomas Thomas Hobbes, w:Leviathan Leviatha\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Out Of Civil States, There Is Alwayes \u0027\u0027Warre\u0027\u0027 Of Every One Against Every One\", \"priority\":4}]}, \"synonyms\":{}}");

